import React, { useState } from 'react';
import Switch from 'react-switch';

const ToggleSwitch =({ handleToggleSwitch }) => {
    const handleChange = (checked) => {
      handleToggleSwitch(checked);
    };

  return (
    <label className="switch">
      <span className="switch-text">Active</span>
      <Switch
          onChange={handleChange}
          checked={false} // Set the initial state of the switch
          uncheckedIcon={false} // Remove the X mark when unchecked
          checkedIcon={false} // Remove the X mark when checked
        />
      <span className="switch-text">Inactive</span>
    </label>
  );
};

export default ToggleSwitch;
